import { useState, useEffect } from 'react';
import { useSearchParams } from 'react-router-dom';
import { getBabysitters } from '../services/api';
import SearchBar from '../components/SearchBar';
import BabysitterCard from '../components/BabysitterCard';

export default function BabysitterList() {
  const [searchParams] = useSearchParams();
  const [babysitters, setBabysitters] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    const filters = Object.fromEntries(searchParams.entries());
    fetchBabysitters(filters);
  }, [searchParams]);

  const fetchBabysitters = async (filters) => {
    try {
      setLoading(true);
      const response = await getBabysitters(filters);
      // Check if response.data has the expected structure
      const babysitterData = response.data?.data?.babysitters || response.data;
      setBabysitters(Array.isArray(babysitterData) ? babysitterData : []);
    } catch (err) {
      console.error('Error fetching babysitters:', err);
      setError('Failed to fetch babysitters');
      setBabysitters([]);
    } finally {
      setLoading(false);
    }
  };

  if (loading) {
    return (
      <div className="flex items-center justify-center min-h-screen">
        <div className="w-16 h-16 border-4 border-primary-500 border-t-transparent rounded-full animate-spin"></div>
      </div>
    );
  }

  return (
    <div className="bg-gray-100 min-h-screen py-8">
      <div className="max-w-7xl mx-auto px-4 sm:px-6 lg:px-8">
        <h1 className="text-3xl font-bold text-gray-900 mb-6">Find a Babysitter</h1>

        <SearchBar />

        {error && (
          <div className="mt-4 p-4 text-sm text-red-800 rounded-lg bg-red-50">
            {error}
          </div>
        )}

        <div className="mt-8 grid grid-cols-1 gap-6 sm:grid-cols-2 lg:grid-cols-3">
          {babysitters.length === 0 ? (
            <div className="col-span-full text-center py-12">
              <p className="text-gray-500">No babysitters found</p>
            </div>
          ) : (
            babysitters.map((babysitter) => (
              <BabysitterCard key={babysitter._id} babysitter={babysitter} />
            ))
          )}
        </div>
      </div>
    </div>
  );
}
